let w = 2400;
let h = 800;

let viz = d3.select("#container")
  .append("svg")
    .attr("width", w)
    .attr("height", h)
    .style("background-color", "white")
;

function gotData(newData){
  console.log(newData);
  let timeConventor = d3.timeParse("%Y-%m-%d-%H-%M");

  transformedData = newData.map(d=>{
    return {app: d.app, type: d.type, time: timeConventor("2019-09-" + d.date + "-16-" + d.Minute)}
  });
  console.log(transformedData);

  let minuteRange = d3.extent(transformedData, function(d){return d.time.getMinutes();});
  console.log(minuteRange);

  let xPadding = 150;
  let xScale = d3.scaleLinear().domain(minuteRange).range([xPadding, w-xPadding]);

  var xAxis = d3.axisBottom(xScale).ticks(5).tickSize(10);

  let xAxisGroup = viz.append("g").attr("class", "xaxis");
  xAxisGroup.call(xAxis);

  let xAxisYPos = h - 100;
  xAxisGroup.attr("transform", "translate(0, 720)");

  let topPadding = 150;
  let yScale = d3.scaleLinear().domain(d3.extent(newData, function(d){return d.date})).range([topPadding, xAxisYPos]);

  var yAxis = d3.axisLeft(yScale).ticks(7).tickSize(0);
  let yAxisgroup = viz.append("g").attr("class", "yaxis").call(yAxis);
  yAxisgroup.attr("transform", "translate(100, -30)");

  function coordianteSet(d){
    let x = xScale(d.time.getMinutes());
    let y = yScale(d.time.getDate());
    let z = y - 55;
    return "translate(" + x + ", " + z + ")";
  }

  let dataGroups = viz.selectAll(".datagroup").data(transformedData).enter()
      .append("g")
      .attr("class", "datagroup")
  ;

  function appSet(d){
      if (d.app == "Weibo"){
        return svgWeibo;
      } else if (d.app == "Zhihu"){
        return svgZhihu;
      } else if (d.app == "Huxiu") {
        return svgHuxiu;
      } else if (d.app == "Taobao"){
        return svgTaobao;
      } else if (d.app == "Dongfang Caifu"){
        return svgDongfang;
      } else if (d.app == "Tao Piaopiao"){
        return svgTaopiaopiao;
      } else if (d.app == "Dongqiu Di"){
        return svgDongqiudi;
      } else if (d.app == "Wangyi Xinwen"){
        return svgWangyi;
      }
  }

  let textOne = viz.append("text").text("September")
    .attr("x", 35).attr("y", 70)
    .attr("fill", "black")
    .attr("font-family", "Courier New")
    .attr("font-size", "20px")
  ;

  let textTwo = viz.append("text").text("4:00 pm")
      .attr("x", 45).attr("y", 730)
      .attr("fill", "black")
      .attr("font-family", "Courier New")
      .attr("font-size", "20px")
  ;

  let textPadding = w - 130;
  let textThree = viz.append("text").text("5:00 pm")
      .attr("x", textPadding).attr("y", 730)
      .attr("fill", "black")
      .attr("font-family", "Courier New")
      .attr("font-size", "20px")
  ;

  let apps = dataGroups.html(appSet);

  dataGroups.selectAll("path").attr("transform", "scale(0.12)");

  apps.attr("transform", coordianteSet);


}

d3.json("data1.json").then(gotData);

